import logo from './logo.svg';
import './App.scss';
import Logo from "./assets/images/BrainFlix-logo.svg";
import UserImage from "./assets/images/Mohan-muruge.jpg";
import Upload from "./assets/images/icons/upload.svg";
import Preview from "./assets/images/Upload-video-preview.jpg";

function App() {
  return (
    <>
      <header className='header'>
        <img className="header__logo" src={Logo} alt="BrainFlix Logo" />
        <form className="header__form" action="" method="">
          <textarea className="header__form--box" type="search" placeholder="Search"
          // style="resize:none;"
          ></textarea>
        </form>
        <img className="header__user" src={UserImage} alt="User" />
        <button className="header__user">
          <img alt="Upload Icon" src={Upload} />
          UPLOAD
        </button>
      </header>

      <main className='main'>
        <video autoplay className='video'>
          <source src="" type="video/mp4" />
          <img src={Preview} />
        </video>
        <h1 className='video__head'>BMX Rampage:2021 Highlights</h1>
      </main>


    </>
  );
}

export default App;
